import React, { useState } from "react";
import {
  AppBar,
  Box,
  Container,
  CssBaseline,
  TextField,
  Button,
  Card,
  CardContent,
  Typography,
  IconButton,
  ThemeProvider,
  createTheme,
} from "@mui/material";
import { Favorite, FavoriteBorder, Comment, Share } from "@mui/icons-material";

const theme = createTheme({
  palette: {
    primary: {
      main: "#000000",
    },
    background: {
      default: "#f5f5f5",
    },
  },
});

function App() {
  const [threads, setThreads] = useState([
    {
      id: 1,
      content: "Just launched my new project! 🚀",
      author: "John Doe",
      likes: 42,
      comments: 12,
      isLiked: false,
    },
    {
      id: 2,
      content: "Beautiful day for coding! ☀️",
      author: "Jane Smith",
      likes: 28,
      comments: 8,
      isLiked: false,
    },
  ]);
  const [newThread, setNewThread] = useState("");

  const handleLike = (threadId) => {
    setThreads(
      threads.map((thread) =>
        thread.id === threadId
          ? {
              ...thread,
              likes: thread.isLiked ? thread.likes - 1 : thread.likes + 1,
              isLiked: !thread.isLiked,
            }
          : thread
      )
    );
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (newThread.trim()) {
      setThreads([
        {
          id: threads.length + 1,
          content: newThread,
          author: "Current User",
          likes: 0,
          comments: 0,
          isLiked: false,
        },
        ...threads,
      ]);
      setNewThread("");
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Box sx={{ flexGrow: 1 }}>
        <AppBar position="static">
          <Container maxWidth="md">
            <Box sx={{ py: 2 }}>
              <Typography
                variant="h5"
                component="div"
                sx={{ fontWeight: "bold" }}
              >
                Threads
              </Typography>
            </Box>
          </Container>
        </AppBar>

        <Container maxWidth="md" sx={{ mt: 4 }}>
          <Card sx={{ mb: 4 }}>
            <CardContent>
              <form onSubmit={handleSubmit}>
                <TextField
                  fullWidth
                  multiline
                  rows={3}
                  placeholder="Start a thread..."
                  value={newThread}
                  onChange={(e) => setNewThread(e.target.value)}
                  sx={{ mb: 2 }}
                />
                <Button
                  variant="contained"
                  type="submit"
                  disabled={!newThread.trim()}
                  sx={{ float: "right" }}
                >
                  Post
                </Button>
              </form>
            </CardContent>
          </Card>

          {threads.map((thread) => (
            <Card key={thread.id} sx={{ mb: 2 }}>
              <CardContent>
                <Typography variant="subtitle1" sx={{ fontWeight: "bold" }}>
                  {thread.author}
                </Typography>
                <Typography variant="body1" sx={{ my: 1 }}>
                  {thread.content}
                </Typography>
                <Box sx={{ display: "flex", alignItems: "center", gap: 2 }}>
                  <IconButton onClick={() => handleLike(thread.id)}>
                    {thread.isLiked ? (
                      <Favorite color="error" />
                    ) : (
                      <FavoriteBorder />
                    )}
                  </IconButton>
                  <Typography variant="body2">{thread.likes}</Typography>
                  <IconButton>
                    <Comment />
                  </IconButton>
                  <Typography variant="body2">{thread.comments}</Typography>
                  <IconButton>
                    <Share />
                  </IconButton>
                </Box>
              </CardContent>
            </Card>
          ))}
        </Container>
      </Box>
    </ThemeProvider>
  );
}

export default App;
